import "../css/NavUp.css";

const NavUp = () => {
  return (
    <>
      <div className="m-banner col-12">
        <div className="nav-heading">Microsoft Teams</div>
        <form>
          <input
            type="search"
            className="form-control rounded"
            placeholder="Search"
            aria-label="Search"
            aria-describedby="search-addon"
          />
        </form>
        <div>Student Ambassador</div>
      </div>
    </>
  );
};

export default NavUp;
